documentation.long:
 The basic abstraction of the whole secure platform. It provides interfaces for packet and radio management. 
 User application should wire to this configuration in order to use security features of the platform. 
 Packets processed via ProtectLayerC are sent and received via secure platform.

 	@version   0.1
 	@date      2012-2013

*

The basic abstraction of privacy component. It acts as a front-end for the PrivacyP component. It provides interfaces for privacy management, and for sending and receiving packets with privacy protection. It provides virtualization of access to AMSenderC and AMReceiverC. It provides parameterized interfces AMSend and Receive. For every id it provides queue of length one. All components using PrivacyP should wire to this configuration not directly to the PrivacyP. The configuration is used to wire the PrivacyP to other components (interface providers).
